import React from 'react'

const Contact = () => {
    const titleStyle = {
        color: "#7fccbd",
        paddingTop: "20px",
        paddingBottom: "10px",
        fontSize: "30pt",
        fontWeight: "normal",
        margin: "0px",
    }

    const descStyle = {
        color: "white",
        fontSize: "12pt",
        fontWeight: "normal"
    }

  return (
    <div className="container">
         <div className="inner-container dark-gray" style={{padding: "40px"}}>
            <h1 style={titleStyle}>Get in Touch</h1>

            <h2 style={descStyle}>Toronto, Ontario</h2>
            <a style={descStyle} href="mailto:javier.violante123@gmail.com">javier.violante123@gmail.com</a>

         </div>
    </div>
  )
}

export default Contact
